import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence, useScroll, useTransform } from 'framer-motion';
import { FiSearch, FiTag, FiMapPin, FiBriefcase, FiClock, FiFilter, FiMonitor, FiGlobe, FiUsers, FiHeart, FiCalendar, FiDollarSign, FiCode, FiMic } from 'react-icons/fi';
import './EventsList.css';
import { Link } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

const EventsList = () => {
    const [events, setEvents] = useState([]);
    const [loading, setLoading] = useState(true);
    const [searchTerm, setSearchTerm] = useState('');
    const [selectedFilters, setSelectedFilters] = useState({
        type: [],
        tech_stack: [],
        virtual: null
    });
    const { isAuthenticated } = useAuth();
    const { scrollYProgress } = useScroll();
    const opacity = useTransform(scrollYProgress, [0, 0.2], [1, 0]);

    const eventTypes = [
        'Conference',
        'Hackathon',
        'Workshop',
        'Meetup',
        'Webinar',
        'Tech Talk'
    ];

    const techStackOptions = [
        'Python',
        'JavaScript',
        'React',
        'Node.js',
        'AWS',
        'Docker',
        'Kubernetes',
        'Machine Learning',
        'Blockchain',
        'DevOps'
    ];

    useEffect(() => {
        fetchEvents();
    }, []);

    const fetchEvents = async () => {
        try {
            const response = await fetch('http://localhost:8000/events/');
            const data = await response.json();
            setEvents(data);
            setLoading(false);
        } catch (error) {
            console.error('Error fetching events:', error);
            setLoading(false);
        }
    };

    const handleLike = async (id) => {
        try {
            await fetch(`http://localhost:8000/events/${id}/like`, {
                method: 'POST'
            });
            fetchEvents();
        } catch (error) {
            console.error('Error liking event:', error);
        }
    };

    const handleRegister = async (id) => {
        try {
            await fetch(`http://localhost:8000/events/${id}/register`, {
                method: 'POST'
            });
            fetchEvents();
        } catch (error) {
            console.error('Error registering for event:', error);
        }
    };

    const filteredEvents = events.filter(event => {
        const matchesSearch = event.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
            event.organization.toLowerCase().includes(searchTerm.toLowerCase()) ||
            event.description.toLowerCase().includes(searchTerm.toLowerCase());

        const matchesType = selectedFilters.type.length === 0 ||
            selectedFilters.type.includes(event.type);

        const matchesTechStack = selectedFilters.tech_stack.length === 0 ||
            selectedFilters.tech_stack.some(tech => event.tech_stack.includes(tech));

        const matchesVirtual = selectedFilters.virtual === null ||
            event.virtual === selectedFilters.virtual;

        return matchesSearch && matchesType && matchesTechStack && matchesVirtual;
    });

    const containerVariants = {
        hidden: { opacity: 0 },
        visible: {
            opacity: 1,
            transition: {
                staggerChildren: 0.1
            }
        }
    };

    const itemVariants = {
        hidden: { y: 20, opacity: 0 },
        visible: {
            y: 0,
            opacity: 1
        }
    };

    const filterVariants = {
        hidden: { height: 0, opacity: 0 },
        visible: {
            height: 'auto',
            opacity: 1,
            transition: {
                duration: 0.3
            }
        }
    };

    return (
        <div className="events-container">
            <motion.div 
                className="events-header"
                initial={{ opacity: 0, y: -20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ duration: 0.5 }}
                style={{ opacity }}
            >
                <motion.h1
                    initial={{ opacity: 0, y: -20 }}
                    animate={{ opacity: 1, y: 0 }}
                    transition={{ delay: 0.2 }}
                >
                    Tech Events
                </motion.h1>
                <motion.p
                    initial={{ opacity: 0, y: -20 }}
                    animate={{ opacity: 1, y: 0 }}
                    transition={{ delay: 0.3 }}
                >
                    Discover and join exciting tech events, conferences, and meetups
                </motion.p>
            </motion.div>

            <motion.div 
                className="search-filters"
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: 0.2 }}
            >
                <div className="search-box">
                    <FiSearch className="search-icon" />
                    <input
                        type="text"
                        placeholder="Search events..."
                        value={searchTerm}
                        onChange={(e) => setSearchTerm(e.target.value)}
                    />
                </div>

                <div className="filter-section">
                    <h3>Event Type</h3>
                    <div className="filter-options">
                        {eventTypes.map(type => (
                            <button
                                key={type}
                                className={`filter-button ${selectedFilters.type.includes(type) ? 'active' : ''}`}
                                onClick={() => setSelectedFilters(prev => ({
                                    ...prev,
                                    type: prev.type.includes(type)
                                        ? prev.type.filter(t => t !== type)
                                        : [...prev.type, type]
                                }))}
                            >
                                {type}
                            </button>
                        ))}
                    </div>
                </div>

                <div className="filter-section">
                    <h3>Tech Stack</h3>
                    <div className="filter-options">
                        {techStackOptions.map(tech => (
                            <button
                                key={tech}
                                className={`filter-button ${selectedFilters.tech_stack.includes(tech) ? 'active' : ''}`}
                                onClick={() => setSelectedFilters(prev => ({
                                    ...prev,
                                    tech_stack: prev.tech_stack.includes(tech)
                                        ? prev.tech_stack.filter(t => t !== tech)
                                        : [...prev.tech_stack, tech]
                                }))}
                            >
                                {tech}
                            </button>
                        ))}
                    </div>
                </div>

                <div className="filter-section">
                    <h3>Format</h3>
                    <div className="filter-options">
                        <button
                            className={`filter-button ${selectedFilters.virtual === true ? 'active' : ''}`}
                            onClick={() => setSelectedFilters(prev => ({
                                ...prev,
                                virtual: prev.virtual === true ? null : true
                            }))}
                        >
                            Virtual
                        </button>
                        <button
                            className={`filter-button ${selectedFilters.virtual === false ? 'active' : ''}`}
                            onClick={() => setSelectedFilters(prev => ({
                                ...prev,
                                virtual: prev.virtual === false ? null : false
                            }))}
                        >
                            In-Person
                        </button>
                    </div>
                </div>
            </motion.div>

            {loading ? (
                <div className="loading-spinner">
                    <div className="spinner"></div>
                </div>
            ) : (
                <motion.div
                    className="events-grid"
                    variants={containerVariants}
                    initial="hidden"
                    animate="visible"
                >
                    {filteredEvents.map(event => (
                        <motion.div
                            key={event.id}
                            className="event-card"
                            variants={itemVariants}
                        >
                            <div className="event-header">
                                <h2>{event.title}</h2>
                                <span className={`type-badge ${event.type.toLowerCase().replace(' ', '-')}`}>
                                    {event.type}
                                </span>
                            </div>

                            <div className="organization">
                                <FiUsers className="icon" />
                                {event.organization}
                            </div>

                            <div className="location">
                                <FiMapPin className="icon" />
                                {event.location}
                                {event.virtual && <span className="virtual-badge">Virtual</span>}
                            </div>

                            <div className="dates">
                                <FiCalendar className="icon" />
                                {new Date(event.start_date).toLocaleDateString()} - {new Date(event.end_date).toLocaleDateString()}
                            </div>

                            {event.price && (
                                <div className="price">
                                    <FiDollarSign className="icon" />
                                    {event.price}
                                </div>
                            )}

                            {event.tech_stack && event.tech_stack.length > 0 && (
                                <div className="tech-stack">
                                    <FiCode className="icon" />
                                    {event.tech_stack.join(', ')}
                                </div>
                            )}

                            {event.speakers && event.speakers.length > 0 && (
                                <div className="speakers">
                                    <FiMic className="icon" />
                                    {event.speakers.join(', ')}
                                </div>
                            )}

                            <p className="description">{event.description}</p>

                            <div className="card-footer">
                                <button
                                    className="like-button"
                                    onClick={() => handleLike(event.id)}
                                >
                                    <FiHeart className="icon" />
                                    {event.likes}
                                </button>

                                <button
                                    className="register-button"
                                    onClick={() => handleRegister(event.id)}
                                >
                                    Register Now
                                </button>
                            </div>
                        </motion.div>
                    ))}
                </motion.div>
            )}
        </div>
    );
};

export default EventsList;
